import React from 'react';
import './ListItem.css';

const ListItems=({items})=>{
    const itemList = items.map(({name, important, id, done}) => {
        let imStyle = {
            color: important ? 'tomato' : 'black'
        }
        return  <span key={id}>{name}</span>
    })
    return(
        <div className="ListItems">
            {itemList}
        </div>
    )
};
export default ListItems;
